import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DashboardLayoutNavigationLinks from './components/DashboardPageLayout';
import Login from './pages/Login'; // Asegúrate de tener esta página

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/login" element={<Login />} />
                <Route path="/dashboard/*" element={<DashboardLayoutNavigationLinks />} />
                <Route path="*" element={<Login />} /> {/* Redirigir a login si la ruta no existe */}
            </Routes>
        </Router>
    );
}

export default App;
